import { Container, Grid } from "@material-ui/core";

export const Watch = () => {
  return (
    // 全体のデザインを整えるためのコンテナー
    // 詳細：https://material-ui.com/ja/components/container/
    <Container>

      <Grid container spacing={4}>
        <Grid item xs={8}>Video Player Area</Grid>

        <Grid item xs={4}>Video Card List</Grid>
      </Grid>
    </Container>
  );
};
